class Solution {
  List<List<int>> constructProductMatrix(List<List<int>> grid) {
    int n = grid.length;
    int m = grid[0].length;
    List<List<int>> result = List.generate(n, (_) => List.filled(m, 0));
    List<int> rowProducts = List.filled(n, 1);
    List<int> colProducts = List.filled(m, 1);

    // Calculate row and column products
    for (int i = 0; i < n; i++) {
      for (int j = 0; j < m; j++) {
        rowProducts[i] = (rowProducts[i] * grid[i][j]) % 12345;
        colProducts[j] = (colProducts[j] * grid[i][j]) % 12345;
      }
    }

    // Calculate the result for each cell
    for (int i = 0; i < n; i++) {
      for (int j = 0; j < m; j++) {
        int product = 1;
        for (int k = 0; k < n; k++) { // Exclude current row
          if (k != i) {
            product = (product * grid[k][j]) % 12345;
          }
        }
        for (int l = 0; l < m; l++) { // Exclude current column
          if (l != j) {
            product = (product * grid[i][l]) % 12345;
          }
        }
        result[i][j] = product;
      }
    }

    return result;
  }
}
